import React, { useEffect, useState } from 'react';
import { useDispatch } from 'react-redux';
import { fetchItems } from '../store/slices/itemSlice';
import { useSelector } from 'react-redux';

function Products() {
    const dispatch = useDispatch();
    const [items,setItems] = useState();
    const state = useSelector((state)=> state);
    console.log(state);
    console.log(state.items);
    console.log(items)

    useEffect(()=>{
        getItems();
    },[])

    const getItems = async()=>{
        const fetchres = await dispatch(fetchItems());
       if(fetchItems.fulfilled.match(fetchres)){
        setItems((prev)=>{
            return fetchres.payload;
        })
       }
       else if(fetchItems.rejected.match(fetchres)){
        return "Error in fetching data"
       }
    }

    
  return (
    <div className='mt-[8rem]'>
      {
        state.items.isLoading ? <h1>Loading....</h1>:
      state.items.data?.forEach((item)=>{
        
  <h1>{item.title}</h1>
          
        })
      }
    </div>
  )
}

export default Products
